import './map.scss';

function Map() {
    return (
        <>
            

            <div className="container">
            <div className="map_container">
                <div className="map-responsive">
                    <iframe
                        className="map_shop"
                        src={`https://www.google.com/maps/embed/v1/place?key=AIzaSyA0s1a7phLN0iaD6-UE7m4qP-z21pH0eSc&q=Eiffel+Tower+Paris+France`}
                    ></iframe>
                </div>
            </div>
            
            </div>
        </>
    );
}

export default Map;
